import { NavLink } from "react-router-dom";
// import { BsArrowLeft } from "react-icons/bs";
const Index = (props) => {
  return (
    <>
      {props.TitleLink ? (
        <NavLink
          to={props.TitleLink}
          className="profil_emp_inter_page_title finance_inter_page_title"
        >
          {props.TilelIcon}
          {props.Name}
        </NavLink>
      ) : (
        <span>
          {props.TilelIcon}
          {props.Name}
        </span>
      )}
    </>
  );
};
export default Index;
